create table  provincias
( codpro    numeric(2)   not null,
  nombre    varchar(30)  not null,
constraint cp_provincias primary key (codpro)
);

create table  pueblos
( codpue    numeric(5)  not null,
  nombre    varchar(45) not null,
  codpro    numeric(2),
constraint cp_pueblos primary key (codpue),
constraint ca_pue_pro foreign key (codpro) references provincias
  on delete cascade on update cascade
);

create table  clientes
( codcli    numeric(5)  not null,
  nombre    varchar(50) not null,
  direccion varchar(50) not null,
  codpostal varchar(5),
  codpue    numeric(5) not null,
constraint cp_clientes primary key (codcli),
constraint ca_cli_pue foreign key (codpue) references pueblos
  on delete restrict on update cascade
);

CREATE TABLE oficinas (
        codofi numeric(5) NOT NULL,
        codpue numeric(5) NOT NULL,
        region character varying(10) NOT NULL,
        director numeric(5),
        objetivo numeric(9,2),
        ventas numeric(9,2) NOT NULL,
	constraint cp_oficinas primary key (codofi),
constraint ca_ofi_pue foreign key (codpue) references pueblos on delete restrict on update cascade
);

create table  vendedores
( codven    numeric(5)  not null,
  nombre    varchar(50) not null,
  direccion varchar(50) not null,
  codpostal varchar(5),
  codpue    numeric(5)  not null,
  codjefe   numeric(5),
  codofi numeric(5),
constraint cp_vendedores primary key (codven),
constraint ca_ven_pue foreign key (codpue) references pueblos
  on delete restrict on update cascade,
constraint ca_ven_ven foreign key (codjefe) references vendedores
  on delete restrict on update cascade,
constraint ca_ven_ofi foreign key (codofi) references oficinas on delete set null on update cascade
--LIO 
);





create table  articulos
( codart    varchar(8)   not null,
  descrip   varchar(40)  not null,
  precio    numeric(6,2) not null,
  stock     numeric(6),
  stock_min numeric(6),
constraint cp_articulos primary key (codart)
);

create table  facturas
( codfac    numeric(6)  not null,
  fecha     date        not null,
  codcli    numeric(5),
  codven    numeric(5),
  iva       numeric(2),
  dto       numeric(2),
constraint cp_facturas primary key (codfac),
constraint ca_fac_cli foreign key (codcli) references clientes
  on delete set null on update cascade,
constraint ca_fac_ven foreign key (codven) references vendedores
  on delete set null on update cascade,
constraint ri_dto_fac check ( dto between 0 and 50 ) 
);

create table  lineas_fac
( codfac    numeric(6)   not null,
  linea     numeric(2)   not null,
  cant      numeric(5)   not null,
  codart    varchar(8)   not null,
  precio    numeric(6,2) not null,
  dto       numeric(2),
constraint cp_lineas_fac primary key (codfac,linea),
constraint ca_lin_fac foreign key (codfac) references facturas
  on delete cascade on update cascade,
constraint ca_lin_art foreign key (codart) references articulos
  on delete restrict on update cascade,
constraint ri_dto_lin check ( dto between 0 and 50 ) 
);




;





alter table oficinas add constraint ca_ven_ofi foreign key (director) references vendedores on delete set null on update cascade;
